  {
    var identity = await DataPortal.FetchAsync<CustomIdentity>(vm.Model);
    var baseidentity = new ClaimsIdentity(identity.AuthenticationType);
    baseidentity.AddClaim(new Claim(ClaimTypes.Name, identity.Name));
